import React, { Component } from 'react';
import { List, ListItem, Grid, Cell, ListItemContent, ListItemAction, Icon } from 'react-mdl';
import '../pages/Profile/Profile.css';
// import Motivate from '../pages/Motivate/motivate';
class GoalsList extends Component {
    render() {

        return(
            <div className="goalsList">

                <h3 className="DevName" align="center">My Goals</h3> 

                <hr></hr>

                <Grid>
                <Cell col={6}> 

<div className="goalsList"> 
    <h3 align="center" className="DevName">Saved Goals</h3>
    <hr></hr>
    {this.state.Goal ? (
<List>
{ this.state.Goal && this.state.Goal.map(Goal => {
  return (
    <ListItem key={Goal._id}>
      <a href={"/goals/" + Goal._id}>
        <strong>
          {Goal.title}
        </strong>
      </a>
      &nbsp;
      <DeleteBtn onClick={() => this.deleteGoal(Goal._id)} />
    </ListItem>
  );
})}
</List>
) : (
<h3>No Goals to Display</h3>
)}
</div> 
</Cell>
                </Grid>

            <List>
                <ListItem twoLine>
                    <ListItemContent avatar="" >Look for a new job</ListItemContent>
                    <ListItemAction info="">
                    <a href="google.com"><Icon name="X" /></a>
                    </ListItemAction>
                </ListItem>


                <div>
                <form method="get" action="/addquote">
                    <button className="button" style={{float: "right", marginRight: "60px"}} type="submit">Add New Goal</button>
                </form>
                 </div>
            </List>
            </div>

        )


    }
}

export default GoalsList;
